import React, { Component } from 'react'

 class RestaurantCreate extends Component {
     constructor(props) {
         super(props)

         this.state = {
              name:null,
              rating:null,
              address:null,
              email:null,

         }
     }

    render() {
        return (
            <div>
              <h1>Restaurant Create</h1>  
              <div>
                  <input onChange={()=>{this.state}}  placeholder="Enter Restraurant name"/><br /><br />
                  <input placeholder="Enter Restraurant Rating"/><br /><br />
                  <input placeholder="Enter Restraurant Location"/><br /><br />
                  <input placeholder="Enter Restraurant Email"/><br /><br />
                 <button>Submit</button>
              </div>

            </div>
        )
    }
}
export default RestaurantCreate
